import{_ as e,c as r,q as a,o}from"./chunks/framework.BRsttz9t.js";const n="/assets/groupchat.BetqHqwY.png",i="/assets/sun_host.BI4VmHmn.jpg",p="/assets/panelist.BaChAeGK.jpg",l="/assets/duyongkun.CQ_p59gp.jpg",d="/assets/zhaomiaomiao.dXx6awBl.jpg",s="/assets/tianshuishifan.DkDfK8bz.jpg",h="/assets/photo_all_together.FY83jsKs.jpg",c="/assets/award_ceremony.B4pBO3vf.jpg",g="/assets/meetup-1.C_uxuPD9.jpg",m="/assets/meetup-2.BYp7ViW8.jpg",z=JSON.parse('{"title":"PaddleOCR 算法模型挑战赛圆满落幕 & 杭州开发者线下 Meetup","description":"","frontmatter":{"title":"PaddleOCR 算法模型挑战赛圆满落幕 & 杭州开发者线下 Meetup","date":"2024-04-17T00:00:00.000Z","author":{"name":"尤师傅","github":"Harryoung"},"category":"community-activity"},"headers":[],"relativePath":"posts/suzhou-kaifangyuanzi.md","filePath":"posts/suzhou-kaifangyuanzi.md"}'),u={name:"posts/suzhou-kaifangyuanzi.md"};function _(f,t,b,k,P,y){return o(),r("div",null,[...t[0]||(t[0]=[a('<p>2024 年 4 月 12 日，<a href="https://competition.atomgit.com/competitionInfo?id=d25e62a0d7f27876a8c4219bfc0be90e" target="_blank" rel="noreferrer">开放原子开源大赛 PaddleOCR 算法模型挑战赛</a> 决赛路演在苏州工业园区人工智能产业园 G1 栋 3 楼会议中心顺利举行，并取得圆满成功！🎉价值 15 万元的大奖花落谁家？选手们的技术方案有多硬核？快来看看吧~</p><p>BTW，在 4 月 14 日 我们飞桨开源社区的工作人员也顺路来到杭州，在西子湖畔的一家餐厅里举办了杭州开发者线下 Meetup，和众多熟悉又陌生的“网友”成功面基 😊。</p><h2 id="大赛背景" tabindex="-1">大赛背景 <a class="header-anchor" href="#大赛背景" aria-label="Permalink to &quot;大赛背景&quot;">​</a></h2><p><a href="https://www.openatom.org/about" target="_blank" rel="noreferrer">开放原子开源基金会</a> 是致力于推动<strong>全球开源事业</strong>发展的非营利机构。其目标是搭建面向全球开源领域的前沿技术竞争、优秀人才选拔创新成果展示、商业转化引导和对接交流合作平台，广泛传播开源文化、普及开源知识、推广开源项目、提升开源技能，为推进<strong>全球开源生态繁荣</strong>和<strong>可持续发展</strong>提供动力。</p><p>百度飞桨开源社区与开放原子开源基金会的目标和愿景有高度的重合，因此自然而然地达成了合作办赛的意向。继 2023 年百度飞桨联合开放原子共建了「飞桨 PaddlePaddle 开源贡献挑战赛」后（大赛回顾请看 <a href="https://pfcc.blog/posts/wuxi-kaifangyuanzi" target="_blank" rel="noreferrer">这里</a>），这次飞桨团队再度受邀，发布了「PaddleOCR 算法模型挑战赛」。PaddleOCR 算法模型挑战赛包括两道赛题，分别是 OCR 端到端识别任务与通用表格识别任务，要求选手在 PaddleOCR 的基线模型之上，尽可能提升模型精度，同时保证模型的推理速度与基线模型相当（降速不超过 10%）。</p><p>赛题有一定难度，但同时奖金也颇为丰厚🤩：</p><ul><li>赛题一：OCR 端到端识别任务 <ul><li>一等奖：1 支队伍，每支队伍奖金 15 万元</li><li>二等奖：1 支队伍，每支队伍奖金 4 万元</li><li>三等奖：1 支队伍，每支队伍奖金 1 万元</li><li>开源贡献奖：7 支队伍，荣誉证书</li></ul></li><li>赛题二：通用表格识别任务 <ul><li>一等奖：1 支队伍，每支队伍奖金 7 万元</li><li>二等奖：1 支队伍，每支队伍奖金 2 万元</li><li>三等奖：1 支队伍，每支队伍奖金 1 万元</li><li>开源贡献奖：7 支队伍，荣誉证书</li></ul></li></ul><h2 id="赛程回顾" tabindex="-1">赛程回顾 <a class="header-anchor" href="#赛程回顾" aria-label="Permalink to &quot;赛程回顾&quot;">​</a></h2><p>大赛从 1 月 15 日上线，启动报名。经过两个半月的紧张打榜后，于 3 月 31 日正式封榜。经过代码审查与线上初审后，最终在 4 月 12 日在美丽的苏州工业园区举行了决赛路演。</p><p>在打榜过程中，选手们在官方交流群中积极讨论，互帮互助，还不忘给官方提需求😅。</p><p><img src="'+n+'" alt="groupchat"></p><p>热心选手树先生，无私贡献了针对赛题二快速测试模型精度的脚本，得到了群友们的一致好评！开源精神拉满了！😉</p><p>赛题一 B 榜阶段，选手反馈能不能把报错信息展示为实际的报错信息，而不是简单的&quot;没有生成 result.txt&quot;，这样才好定位并解决问题。飞桨运营同学快速评估并作出反应，认为这是一个很合理的需求，必须安排！奈何研发人手实在是紧张，直到午夜 1 点多，才完成改动并上线，保证了选手们顺利通关 B 榜。飞桨的研发小姐姐很拼有木有！✊</p><p>最终，<strong>大赛共报名 211 支团队，总人数达到空前的 671 人。</strong> 不过由于赛题本身还是有一定难度，<strong>最后 10 支队伍提交了作品，8 支队伍通过了代码审查，5 支队伍入围了决赛答辩。</strong></p><blockquote><p>飞桨官方的模型已经很强了，要在此基础上继续提分，还得保证推理速度不下降，真的<strong>很难</strong>。👿 ———— 某个不愿透露姓名的选手</p></blockquote><h2 id="路演现场" tabindex="-1">路演现场 <a class="header-anchor" href="#路演现场" aria-label="Permalink to &quot;路演现场&quot;">​</a></h2><p>孙师傅被我抓去现场当主持人，那叫一个专业！😄</p><p><img src="'+i+'" alt="host"></p><p>我则有幸抱住军哥（<a href="https://github.com/@jzhang533" target="_blank" rel="noreferrer">@jzhang533</a>）和涛姐的大腿，当了一回评审。😎</p><p><img src="'+p+'" alt="panelist"></p><p>选手们的答辩也十分精彩！复旦大学的杜永坤和北京交通大学的赵苗苗，分别针对赛题一和赛题二的模型架构进行了多方面的优化，可以说相当硬核。两位也分别摘得两个赛题的一等奖桂冠，实至名归！</p><p><img src="'+l+'" alt="duyongkunc"></p><p><img src="'+d+'" alt="zhaomiaomiao"></p><p>令人印象深刻的是，赛题二的「识别先锋」队，是天水师范大学的吴衡老师带领三个本科生来参赛，还都是 AI Studio 的忠实用户🤗。尽管他们的显卡资源并不充裕（据说只有几张消费级显卡），但依然阻止不了他们的参赛热情。在他们的脸上，有一丝羞怯，也洋溢着激动和开心。我从他们身上看到了开源的魅力。</p><p><img src="'+s+'" alt="tianshuishifan"></p><p>路演结束，大合照来一张。</p><p><img src="'+h+'" alt="photo_all_together"></p><h2 id="获奖情况" tabindex="-1">获奖情况 <a class="header-anchor" href="#获奖情况" aria-label="Permalink to &quot;获奖情况&quot;">​</a></h2><p>经过紧张的路演和现场打分，最终决出了我们两个赛题的获奖队伍，如下表所示。</p><table tabindex="0"><thead><tr><th>赛题</th><th>奖项</th><th>团队名称（括号内为 AI Studio 团队名）</th><th>仓库地址</th></tr></thead><tbody><tr><td>赛题一</td><td>一等奖</td><td>openocr</td><td><a href="https://atomgit.com/paddleocr_competition/openocr" target="_blank" rel="noreferrer">https://atomgit.com/paddleocr_competition/openocr</a></td></tr><tr><td>赛题一</td><td>二等奖</td><td>zjj421</td><td><a href="https://atomgit.com/paddleocr_competition/zjj421" target="_blank" rel="noreferrer">https://atomgit.com/paddleocr_competition/zjj421</a></td></tr><tr><td>赛题二</td><td>一等奖</td><td>ocr 识别队（珍珠小田田的团队）</td><td><a href="https://atomgit.com/paddleocr_competition/ocr_recognition" target="_blank" rel="noreferrer">https://atomgit.com/paddleocr_competition/ocr_recognition</a></td></tr><tr><td>赛题二</td><td>二等奖</td><td>识别先锋（dudekenny 的团队）</td><td><a href="https://atomgit.com/paddleocr_competition/RecognitionPioneer" target="_blank" rel="noreferrer">https://atomgit.com/paddleocr_competition/RecognitionPioneer</a></td></tr><tr><td>赛题二</td><td>三等奖</td><td>豆没有皮吖</td><td><a href="https://atomgit.com/paddleocr_competition/doumeiyoupiya" target="_blank" rel="noreferrer">https://atomgit.com/paddleocr_competition/doumeiyoupiya</a></td></tr><tr><td>赛题二</td><td>开源贡献奖</td><td>树先生</td><td><a href="https://atomgit.com/paddleocr_competition/Mr.Tree" target="_blank" rel="noreferrer">https://atomgit.com/paddleocr_competition/Mr.Tree</a></td></tr><tr><td>赛题二</td><td>开源贡献奖</td><td>几支孤鸭嘎嘎嘎（两只孤鸭嘎嘎嘎的团队）</td><td><a href="https://atomgit.com/paddleocr_competition/duckgaga" target="_blank" rel="noreferrer">https://atomgit.com/paddleocr_competition/duckgaga</a></td></tr><tr><td>赛题二</td><td>开源贡献奖</td><td>长城信息（飞行的的团队）</td><td><a href="https://atomgit.com/paddleocr_competition/GreatWallInfo_task2" target="_blank" rel="noreferrer">https://atomgit.com/paddleocr_competition/GreatWallInfo_task2</a></td></tr></tbody></table><p>恭喜所有的获奖队伍！🎉🎉🎉你们都是开源创新之路上的佼佼者！🚀🚀🚀</p><p><img src="'+c+'" alt="award_ceremony"></p><h2 id="paddleocr-开源共建研讨会" tabindex="-1">PaddleOCR 开源共建研讨会 <a class="header-anchor" href="#paddleocr-开源共建研讨会" aria-label="Permalink to &quot;PaddleOCR 开源共建研讨会&quot;">​</a></h2><p>路演结束之后，距离午饭还有一段时间。我们便借着这个机会，邀请了参赛选手们举行了一场主题为「PaddleOCR 开源共建」的研讨会。</p><p>军哥表达了希望能够以 PaddleOCR 作为试点项目，启动飞桨开源项目社区化治理的想法。纵观国际上优秀的开源项目，都是由社区驱动的，而国内的很多开源项目，却往往只由某一家公司主导，这样其实不利于开源项目的可持续发展。大家纷纷表示了认同，但也提出了国内<strong>拿来主义盛行、开发者生存压力大、做开源只能用爱发电</strong>等现实的问题。</p><p>虽然在国内开源项目的纯社区化治理道阻且艰，但飞桨团队还是要积极推动尝试。如果做成了，将是非常有意义的一件事。👊</p><blockquote><p>大家讨论的太入神，都忘记拍照留念了 😭</p></blockquote><h2 id="杭州开发者线下-meetu-剪影" tabindex="-1">杭州开发者线下 Meetu 剪影 <a class="header-anchor" href="#杭州开发者线下-meetu-剪影" aria-label="Permalink to &quot;杭州开发者线下 Meetu 剪影&quot;">​</a></h2><p>在 4 月 14 日，我们也邀请了 14 位（其中🐦了一位）飞桨开源社区的开发者，在西湖虎跑胖的餐厅里面基交友～军哥给每人都准备了一份神秘礼品哦 🎁。</p><p><img src="'+g+'" alt="meetup-1"></p><blockquote><p>以下为痛失真名现场</p><ul><li>第一排（从左往右）：马贺达 <a href="https://github.com/WintersMontagne10335" target="_blank" rel="noreferrer">@WintersMontagne10335</a>、尤江彬 <a href="https://github.com/Harryoung" target="_blank" rel="noreferrer">@Harryoung</a>、张军 <a href="https://github.com/jzhang533" target="_blank" rel="noreferrer">@jzhang533</a>、骆涛 <a href="https://github.com/luotao123" target="_blank" rel="noreferrer">@luotao123</a>、董黄莹 <a href="https://github.com/1want2sleep" target="_blank" rel="noreferrer">@1want2sleep</a>、吴奕琳 <a href="https://github.com/WoWYoYLoL" target="_blank" rel="noreferrer">@WoWYoYLoL</a>、方国勇 <a href="https://github.com/ooooo-create" target="_blank" rel="noreferrer">@ooooo-create</a>、杨昌辉 <a href="https://github.com/Yang-Changhui" target="_blank" rel="noreferrer">@Yang-Changhui</a>、刘佳新家属</li><li>第二排（从左往右）：汪昕 <a href="https://github.com/GreatV" target="_blank" rel="noreferrer">@GreatV</a>、吴荣飞 <a href="https://github.com/lknt" target="_blank" rel="noreferrer">@lknt</a>、刘益斌 <a href="https://github.com/YibinLiu666" target="_blank" rel="noreferrer">@YibinLiu666</a>、孙钟恺 <a href="https://github.com/sunzhongkai588" target="_blank" rel="noreferrer">@sunzhongkai588</a>、王海涛 <a href="https://github.com/yulangz" target="_blank" rel="noreferrer">@yulangz</a>、叶柯 <a href="https://github.com/cocoshe" target="_blank" rel="noreferrer">@cocoshe</a>、周高威 <a href="https://github.com/Eacient" target="_blank" rel="noreferrer">@Eacient</a>、杨泽群 <a href="https://github.com/idontkonwher" target="_blank" rel="noreferrer">@idontkonwher</a>、刘佳新 <a href="https://github.com/Marshalldteach" target="_blank" rel="noreferrer">@Marshalldteach</a></li></ul></blockquote><p><img src="'+m+'" alt="meetup-2"></p>',42)])])}const j=e(u,[["render",_]]);export{z as __pageData,j as default};
